import React, { useState } from 'react';
import UploadComponent from './components/UploadComponent';
import HorarioUploadComponent from './components/HorarioUploadComponent';

function App() {
  const [currentComponent, setCurrentComponent] = useState('main');

  const renderComponent = () => {
    switch (currentComponent) {
      case 'CargaReloj':
        return <UploadComponent />;
      case 'CargaHorario':
        return <HorarioUploadComponent />;
      case 'main':
      default:
        return (
          <div className="main">
            <h1>Carga de Archivos</h1>
            <button onClick={() => setCurrentComponent('CargaReloj')}>Carga Reloj</button>
            <button onClick={() => setCurrentComponent('CargaHorario')}>Carga Horario</button>
            <button onClick={() => alert('Menú no funcional')}>Menú</button>
          </div>
        );
    }
  };

  return (
    <div className="App">
      {renderComponent()}
    </div>
  );
}

export default App;
